function gcd(a, b) {
    while (b !== 0) {
        let temp = b;
        b = a % b;
        a = temp;
    }
    return a;
}
return gcd(56, 128);

function isPrime(num) {
    if (num <= 1) return false;
    for (let i = 2; i <= Math.sqrt(num); i++) {
        if (num % i === 0) return false;
    }
    return true;
}

let sum = 0;
for (let i = 2; i <= 999; i++) {
    if (isPrime(i)) {
        sum += i;
    }
}
